const data = [
  {
    baseURL: "https://developer.mozilla.org/en-US/docs/Web/JavaScript",
    extensions: [
      { title: "Array", url: "/Reference/Global_Objects/Array" },
      { title: "Object", url: "/Reference/Global_Objects/Object" },
      { title: "Function", url: "/Reference/Global_Objects/Function" },
      { title: "async", url: "/Reference/Statements/async_function" },
    ],
  },
  { baseURL: "https://www.w3schools.com/icons/icons_reference.asp", extensions: false },
  //   { baseURL: "", extensions: [] },
];

export default data;
